import React from "react";
import { Link, Route } from "react-router-dom";

const navLinks = [
  {
    title: "Home",
    path: "/",
  },
  {
    title: "Blog",
    path: "/blog",
  },
  {
    title: "Contact Us",
    path: "/contact-us",
  },
  {
    title: "Login",
    path: "/login",
  },
];

const Navigation = () => {
  return (
    <div>
      <nav className="site-navigation">
        <span>Stalic"s blog</span>
        <ul>
          {navLinks.map((link, index) => {
            return (
              <li key={index}>
                <Link to={link.path}>{link.title}</Link>
              </li>
            );
          })}
        </ul>
      </nav>
    </div>
  );
};

export default Navigation;
